import {SIGNED_IN,SIGNED_OUT} from './types';

export const signedIn = (data) => {
    return (dispatch) => {
        dispatch({
            type: SIGNED_IN,
            payload: data
        })
    }
}

export const signedOut = (data) => {
    return (dispatch) => {
        dispatch({
            type: SIGNED_OUT,
            payload: data
        })
    }
}
